import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import "../styles/Auth.css";

const Auth = ({ onClose }) => {
  const location = useLocation();
  const [isLogin, setIsLogin] = useState(true);

  useEffect(() => {
    if (location.pathname === '/auth/signup') {
      setIsLogin(false);
    } else {
      setIsLogin(true);
    }
  }, [location.pathname]);

  const handleToggle = () => {
    setIsLogin(!isLogin);
  };

  return (
    <div className="auth-modal">
      <div className="auth-overlay" onClick={onClose}></div>
      <div className="auth-wrapper">
        <button className="close-btn" onClick={onClose}>x</button>
        <div className="wrapper">
          <div className="title-text">
            <div className={`title login ${isLogin ? 'active' : ''}`}>Login Form</div>
            <div className={`title signup ${!isLogin ? 'active' : ''}`}>Signup Form</div>
          </div>
          <div className="form-container">
            <div className="slide-controls">
              <input
                type="radio"
                name="slide"
                id="login"
                checked={isLogin}
                onChange={handleToggle}
              />
              <input
                type="radio"
                name="slide"
                id="signup"
                checked={!isLogin}
                onChange={handleToggle}
              />
              <label htmlFor="login" className="slide login" onClick={handleToggle}>
                Login
              </label>
              <label htmlFor="signup" className="slide signup" onClick={handleToggle}>
                Signup
              </label>
              <div className="slider-tab"></div>
            </div>
            <div className="form-inner">
              {isLogin ? (
                <form className="login">
                  <div className="field">
                    <input type="text" placeholder="Email Address" required />
                  </div>
                  <div className="field">
                    <input type="password" placeholder="Password" required />
                  </div>
                  <div className="field btn">
                    <input type="submit" value="Login" />
                  </div>
                </form>
              ) : (
                <form className="signup">
                  <div className="field">
                    <input type="text" placeholder="Email Address" required />
                  </div>
                  <div className="field">
                    <input type="password" placeholder="Password" required />
                  </div>
                  <div className="field">
                    <input type="password" placeholder="Confirm password" required />
                  </div>
                  <div className="field btn">
                    <input type="submit" value="Signup" />
                  </div>
                </form>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Auth;
